import Navbar from "../components/Navbar";

const NewCode = () => {
  return (
    <div>
      <Navbar />
      <div>
        <input placeholder="access code..."></input>
        <input type="number" placeholder="duration"></input>
      </div>
      
    </div>
  );
};

export default NewCode;
